"""---

## Data Cleansing with ***Spark***
"""

dt.printSchema()

"""- Reference: https://spark.apache.org/docs/3.1.1/api/python/reference/api/pyspark.sql.functions.to_timestamp.html"""

# Change timestamp type string to datetime
from pyspark.sql import functions as f # import StringType

dt_clean = dt.withColumn('timestamp',
                         f.to_timestamp(dt.timestamp, 'yyyy-MM-dd HH:mm:ss'))
dt_clean.show(5)

dt_clean.select(['timestamp']).printSchema()

"""Syntactical Anomalies"""

dt_clean.select('Country').distinct().count()

dt_clean.select('Country').distinct().sort('Country').show(999, False) # False is full Text

dt_clean.where(dt_clean['Country'] == 'Japane').count()

# Change `Japane` to `Japan` (Country column)
from pyspark.sql.functions import when

dt_clean_country = dt_clean.withColumn('CountryUpdate',
                                       when(dt_clean['Country'] == 'Japane', 'Japan')
                                       .otherwise(dt_clean['Country']))

dt_clean_country.where(dt_clean_country['CountryUpdate'] == 'Japane').count()

dt_clean_country.where(dt_clean_country['Country'] == 'Japane').show(5)

# replace column country
dt_clean = dt_clean_country.drop('Country').withColumnRenamed('CountryUpdate', 'Country')
dt_clean.where(dt_clean['Country'] == 'Japan').show(5)

"""Semantic Anomalies"""

dt_clean.select('user_id').show(10)

dt_clean.select('user_id').count()

"""Build password by Regular Expression 
- ref: https://www.regex101.com
"""

from pyspark.sql.functions import col, sum

dt_nulllist = dt_clean.select([ sum(col(colname).isNull().cast("int")).alias(colname) for colname in dt_clean.columns ])

dt_clean.summary("count").show(),
dt_nulllist.show()

regex = '^[0-9a-z]{8}$'
dt_clean.where(dt_clean["user_id"].rlike(regex)).count()

# Transform wrong data in user_id
dt_clean.where( ~ dt_clean["user_id"].rlike(regex)).show(),

dt_clean.where(dt_clean['user_id'].isNull()).show()

dt_clean_user = dt_clean.withColumn('user_id_update',
                                    when(dt_clean['user_id'] == 'ca86d17200', 'ca86d172')
                                    .otherwise(dt_clean['user_id']))

dt_clean_user.where(dt_clean_user['user_id'] == 'ca86d17200').show()

dt_clean = dt_clean_user.drop('user_id').withColumnRenamed('user_id_update', 'user_id')

dt_clean.where(dt_clean['user_id'] == 'ca86d172').show()

dt_clean = dt_clean.withColumn('user_id',
                                    when(dt_clean['user_id'].isNull(),'00000000')
                                    .otherwise(dt_clean['user_id']))

dt_clean.where(dt_clean['user_id'] == '00000000').show()

"""Outliers"""

dt_clean_pd = dt_clean.toPandas()

sns.boxplot(x = dt_clean_pd['price'])

dt_clean.where( dt_clean.price > 80).select('book_id').distinct().show()

